Here's a C++ program that computes the maximum profit by choosing jobs through Job sequencing. The program takes the list of profits, deadlines, and time limits for jobs, and outputs the sequence of chosen jobs based on their ascending job numbers, the profits of those jobs, and the total profit earned.

```cpp
#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

struct Job {
    int id;      // Job ID
    int profit;  // Profit of the job
    int deadline; // Deadline of the job
};

bool compareByProfit(Job a, Job b) {
    // Sort by profit in descending order
    return a.profit > b.profit;
}

int main() {
    // Input size is predefined as 4 jobs
    int n = 4;

    // Input arrays
    vector<int> profits(n);
    vector<int> deadlines(n);
    vector<int> timeLimits(n);

    cout << "Enter profits: ";
    for (int i = 0; i < n; i++) {
        cin >> profits[i];
    }

    cout << "Enter deadlines: ";
    for (int i = 0; i < n; i++) {
        cin >> deadlines[i];
    }

    cout << "Enter time limits: ";
    for (int i = 0; i < n; i++) {
        cin >> timeLimits[i];
    }

    // Create an array to store jobs
    vector<Job> jobs;
    for (int i = 0; i < n; i++) {
        jobs.push_back({i + 1, profits[i], deadlines[i]});
    }

    // Sort jobs by profit in descending order
    sort(jobs.begin(), jobs.end(), compareByProfit);

    // To store the result of chosen jobs
    vector<int> result;
    vector<int> jobProfit;

    // Track slots available for scheduling jobs
    vector<bool> slots(n, false);

    int totalProfit = 0;

    // Process all jobs
    for (int i = 0; i < n; i++) {
        // Find a slot for the job (deadline must not exceed the size of slots)
        for (int j = min(n, jobs[i].deadline) - 1; j >= 0; j--) {
            if (!slots[j]) { // Slot is free
                result.push_back(jobs[i].id);       // Add job ID to result
                jobProfit.push_back(jobs[i].profit); // Add profit to result
                totalProfit += jobs[i].profit;     // Add profit to total
                slots[j] = true;                   // Mark slot as occupied
                break;
            }
        }
    }

    // Sort the chosen jobs by their IDs in ascending order
    sort(result.begin(), result.end());

    // Output
    cout << "Chosen Job Numbers (ascending order): ";
    for (int i : result) {
        cout << i << " ";
    }
    cout << endl;

    cout << "Profits of chosen jobs: ";
    for (int i : result) {
        cout << profits[i - 1] << " "; // Access profit by job ID
    }
    cout << endl;

    cout << "Total Profit Earned: " << totalProfit << endl;

    return 0;
}
```

### Example Input/Output

#### Input
```
Enter profits: 5 3 4 6
Enter deadlines: 3 2 2 1
Enter time limits: 1 2 1 1
```

#### Output
```
Chosen Job Numbers (ascending order): 1 3 4 5
Profits of chosen jobs: 4 6 15

