Here's a complete C# program that meets all the requirements using a custom `RationalNumber` class:

```csharp
using System;

class RationalNumber
{
    private int numerator;
    private int denominator;

    // Property accessors
    public int Numerator
    {
        get { return numerator; }
        set { numerator = value; }
    }

    public int Denominator
    {
        get { return denominator; }
        set { denominator = (value != 0) ? value : 1; } // Prevent division by zero
    }

    // Constructor with numerator and denominator
    public RationalNumber(int num, int denom)
    {
        Numerator = num;
        Denominator = denom;
    }

    // Constructor with integer and fraction: intPart, num, denom
    public RationalNumber(int intPart, int num, int denom)
    {
        Denominator = denom;
        Numerator = intPart * denom + num;
    }

    // Copy constructor
    public RationalNumber(RationalNumber other)
    {
        this.Numerator = other.Numerator;
        this.Denominator = other.Denominator;
    }

    // Get integer part
    public int ToIntegerPart()
    {
        return Numerator / Denominator;
    }

    // String representation
    public override string ToString()
    {
        return $"{Numerator}/{Denominator}";
    }
}

class Program
{
    static void Main()
    {
        // Create rational numbers
        RationalNumber r1 = new RationalNumber(4, 3);
        RationalNumber r2 = new RationalNumber(5, 1, 7);   // 5 + 1/7 = 36/7
        RationalNumber r3 = new RationalNumber(r1);        // copy r1

        Console.WriteLine("Initial values:");
        Console.WriteLine($"r1: {r1}");
        Console.WriteLine($"r2: {r2}");
        Console.WriteLine($"r3: {r3}");

        // Modify r1
        r1.Numerator = 5;
        r1.Denominator *= 3;

        // Modify r2
        r2.Numerator -= 2;

        // Modify r3
        r3.Numerator += 10;
        r3.Denominator *= 10;

        Console.WriteLine("\nAfter modifications:");
        Console.WriteLine($"r1: {r1}, Integer part: {r1.ToIntegerPart()}");
        Console.WriteLine($"r2: {r2}, Integer part: {r2.ToIntegerPart()}");
        Console.WriteLine($"r3: {r3}, Integer part: {r3.ToIntegerPart()}");
    }
}
```

